input.command:
python3 << 'ENDPYTHON'
import json
import re

with open('/Users/imorgado/Desktop/FACEIQPAID/FACEIQ-RACE&GENDER.har', 'r', encoding='utf-8', errors='ignore') as f:
    content = f.read()

har_data = json.loads(content)

# Look through all entries for any that explicitly have "white" race with metric data
all_metrics_by_race = {}

for entry in har_data.get('log', {}).get('entries', []):
    url = entry.get('request', {}).get('url', '')
    resp = entry.get('response', {}).get('content', {}).get('text', '')

    if not resp or 'idealMin' not in resp:
        continue

    # Try to parse JSON responses
    try:
        data = json.loads(resp)
        if isinstance(data, dict) and 'face' in data:
            face = data['face']
            gender = face.get('gender', '')
            race = face.get('race', '')
            harmony = face.get('harmonyAnalysis', {})

            if harmony and gender and race:
                front_ratios = harmony.get('front', {}).get('ratios', [])
                side_ratios = harmony.get('side', {}).get('ratios', [])

                if front_ratios:
                    key = f"{gender}|{race}"
                    if key not in all_metrics_by_race:
                        all_metrics_by_race[key] = {
                            'front': front_ratios,
                            'side': side_ratios,
                            'url': url
                        }
                        print(f"Found: {key} with {len(front_ratios)} front + {len(side_ratios)} side metrics")
    except:
        pass

print(f"\nTotal unique gender/race combinations with clean API data: {len(all_metrics_by_race)}")
for k in sorted(all_metrics_by_race.keys()):
    print(f"  {k}")
ENDPYTHON

